import React, { useState } from 'react';
import { useParams } from 'react-router-dom';

const productData = [
  { id: 1, name: 'Normal Mutton', price: '₹800', type: 'Spicy', description: 'A classic spicy mutton curry with bones.' },
  { id: 2, name: 'BoneLess Mutton', price: '₹1000', type: 'Gravy', description: 'Soft, juicy boneless mutton pieces in rich gravy.' },
  { id: 3, name: 'Mutton Kudal', price: '₹280', type: 'Spicy', description: 'Traditional South Indian spicy kudal mutton.' },
  { id: 4, name: 'Mutton Thalai', price: '₹300', type: 'Gravy', description: 'Delicious head meat in flavorful masala gravy.' },
  { id: 5, name: 'Mutton Kaal', price: '₹200', type: 'Soup', description: 'Spicy and healthy goat leg soup (paaya).' },
];

const OrderPage = () => {
  const { productId } = useParams();
  const product = productData.find(p => p.id === parseInt(productId));

  const [name, setName] = useState("");
  const [phone, setPhone] = useState("");
  const [quantity, setQuantity] = useState("");
  const [address, setAddress] = useState("");

  const handleSubmit = (e) => {
    e.preventDefault();
    if (!name || !phone || !quantity || !address) {
      alert("Please fill all fields.");
      return;
    }
    alert(`Order placed successfully!\nName: ${name}\nPhone: ${phone}\nQuantity: ${quantity}\nAddress: ${address}`);
    setName("");
    setPhone("");
    setQuantity("");
    setAddress("");
  };

  if (!product) {
    return (
      <div style={{ padding: '30px' }}>
        <h2>Product not found</h2>
      </div>
    );
  }

  return (
    <div style={{ padding: '30px' }}>
      <h2>Order: {product.name}</h2>
      <p><strong>Type:</strong> {product.type}</p>
      <p><strong>Price:</strong> {product.price}</p>
      <p><strong>Description:</strong> {product.description}</p>

      <form onSubmit={handleSubmit} style={{ marginTop: '30px', maxWidth: '400px' }}>
        <label style={{ display: 'block', marginBottom: '10px' }}>
          Name:
          <input type="text" value={name} onChange={e => setName(e.target.value)} required style={{ width: '100%', padding: '8px' }} />
        </label>
        <label style={{ display: 'block', marginBottom: '10px' }}>
          Phone Number:
          <input type="tel" value={phone} onChange={e => setPhone(e.target.value)} required style={{ width: '100%', padding: '8px' }} />
        </label>
        <label style={{ display: 'block', marginBottom: '10px' }}>
          Quantity (in Kg or No):
          <input type="text" value={quantity} onChange={e => setQuantity(e.target.value)} required style={{ width: '100%', padding: '8px' }} />
        </label>
        <label style={{ display: 'block', marginBottom: '10px' }}>
          Address:
          <textarea value={address} onChange={e => setAddress(e.target.value)} required style={{ width: '100%', padding: '8px' }}></textarea>
        </label>
        <button type="submit" style={{
          backgroundColor: '#B22222',
          color: 'white',
          padding: '10px 15px',
          border: 'none',
          borderRadius: '5px',
          cursor: 'pointer'
        }}>
          Place Order
        </button>
      </form>
    </div>
  );
};

export default OrderPage;
